```js
// this = arr1

Array.prototype.concat = function(...items) {
  // 1.  this  ,   
  //    ,   arr1   
  // ( -  )
  let obj = ToObject(this);

  // 2.    A  0
  let A = ArraySpeciesCreate(obj, 0);

  // 3.   n
  let n = 0;

  // 4.  obj   items
  items.unshift(obj);

  // 5.    E  items
  for (const E of items) {
    // a. ,   
    let spreadable = IsConcatSpreadable(E);

    // b.  
    if (spreadable === true) {
      // i.     E
      let len = LengthOfArrayLike(E);

      // ii. ,        
      if (n + len > 2**53 - 1) {
        throw new TypeError("Concatenation result exceeds the maximum array length");
      }

      // iii.   k
      let k = 0;

      // iv. ,  k < len
      while (k < len) {
        // 1.     k
        let Pk = ToString((k));

        // 2. ,      k  E
        let exists = HasProperty(E, Pk);

        // 3.   
        if (exists === true) {
          // a.     k
          let subElement = Get(E, Pk);

          // b.     
          CreateDataPropertyOrThrow(A, ToString((n)), subElement);
        }

        // 4.   n  k
        n = n + 1;
        k = k + 1;
      }
    } else {
      // c.  
      // i.   E   
      CreateDataPropertyOrThrow(A, ToString((n)), E);

      // ii.   n
      n = n + 1;
    }
  }

  // 6.       n
  Set(A, "length", (n), true);

  // 7.   
  return A;
};
